import React from 'react';
import { useLocation } from 'react-router-dom';
import { useEffect } from 'react';
import axios from 'axios';


export default function Mainpage() {

    const data=useLocation();
    const authtoken=data.state.authtoken;

    useEffect(()=>{
        axios
          .get("http://localhost:4000/")
          .then(res => console.log(res))
          .catch(err => console.error(err));
    },[]);

    return (
        <>

            <div className='navbar'>
                <img height={"50px"} src={require("../images/logo.png")} />
                <div className='profile-div'>
                    <img className="rounded-circle" width={"50px"} height={"50px"} src={require("../images/image.webp")} />
                    <span >Waqar Ahmed</span>

                </div>

            </div>




            <div className='mainpage-div'>
                <button type="button" className="btn btn-primary ms-3">Mark Attendence</button>
                <button type="button" className="btn btn-secondary ms-3">Mark Leave</button>
                <button type="button" className="btn btn-info ms-3" >View Attendence</button>
            </div>
        </>
    )
}
